import React from 'react';
import { Container, Col } from 'reactstrap';

const Landing = (props) => {
	return (
		<Container>
			<Col md="12">
                <Col md="8">
                    <img src='https://www.trends.fr/wp-content/uploads/2016/12/nike-uptempo-black-pack-5-1800x1200.jpg'/>
                </Col>
                <Col md="4">
                    <img src='https://i.pinimg.com/originals/72/f0/7f/72f07f2113f5922c684372082acf3062.jpg'/>
                </Col>
            </Col>
		</Container>
	);
};

export default Landing;
